import React from 'react';
import {FiCoffee} from 'react-icons/fi';

const Navbar = () => {
    return (
        <div className="navbar-conteiner">
            <div className="logo-icon">
                <a><FiCoffee/>Post</a>
            </div>
        </div>
    )
}

export default Navbar;
